import React from 'react';
import { NeuCard, NeuInput, NeuHeading, NeuButton } from 'neumorphic-ui';

import { Container } from './styles';

export default function Login() {
  return (
    <Container>
      <NeuCard height={450} width={600}>
        <NeuHeading text="LOGIN" />
        <form>
          <NeuInput placeholder="Email"></NeuInput>
          <NeuInput placeholder="Password"></NeuInput>
        </form>
        <NeuButton text="Entrar" />
      </NeuCard>
    </Container>
  );
}
